import styles from "./header.module.css";
import clsx from "clsx";
import { Link } from "react-router-dom";
// import {FontAwesomeIcons} from react-icons;

import logo from "../../assets/images/logo1.png" ;
export default function Header() {
  return (
    <div className={styles.header}>
     <div className={styles.header_container}>
            <img src={logo}alt="" />
           <Link className={styles.link} to="/"><div>ARTY</div></Link>
           <Link className={styles.link} to="/"><div>Trang chủ</div></Link>
           <Link className={styles.link} to="/ticket/buy"><div>Mua vé</div></Link>
           <Link className={styles.link} to="/watch"><div>Xem online</div></Link>
            <div className={styles.log }>
               <div className={styles.login}>Đăng nhập</div>
                <div className={styles.signup}>Đăng ký</div> 
            </div>
            
     </div>

    </div>
  );
}
